&lt;p&gt;&lt;strong&gt;Descripci&oacute;n:&nbsp;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Todos a bordo del tren de cumplea&ntilde;os de la Casa de Mickey Mouse: &iexcl;Mickey y Minnie organizan un desfile en tu honor! Carga en el tren todo lo que necesitas para una fiesta de cumplea&ntilde;os perfecta: una tarta para construir, globos y ladrillos decorados con regalos. &iquest;Cu&aacute;ntos a&ntilde;os cumples hoy? Con los ladrillos numerados del 1 al 5 para indicar la edad, Mickey y Minnie te proporcionar&aacute;n diversi&oacute;n a&ntilde;o tras a&ntilde;o. A los ni&ntilde;os les encantar&aacute;n las infinitas oportunidades de jugar a interpretar y disfrutar&aacute;nmientras desarrollan sus habilidades de construcci&oacute;n con los grandes ladrillos LEGO&reg; DUPLO&reg; de llamativos colores, dise&ntilde;ados especialmente para peque&ntilde;os constructores. Incluye 2 figuras LEGO DUPLO: Mickey Mouse y Minnie Mouse.&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Tema: Duplo&lt;/li&gt;
&lt;li&gt;Incluye 2 figuras LEGO&reg; DUPLO&reg;: Mickey Mouse y Minnie Mouse.&lt;/li&gt;
&lt;li&gt;Contiene un tren y una tarta de cumplea&ntilde;os para construir.&lt;/li&gt;
&lt;li&gt;Accesorios incluidos: globos, una vela y 3 ladrillos decorados con regalos para dar pie a fant&aacute;sticas historias.&lt;/li&gt;
&lt;li&gt;Los ladrillos numerados del 1 al 5 ayudan a los ni&ntilde;os a aprender su edad y favorecen el reconocimiento temprano de los n&uacute;meros.&lt;/li&gt;
&lt;li&gt;Las figuras y accesorios despiertan la imaginaci&oacute;n y estimulan el juego de interpretaci&oacute;n.&lt;/li&gt;
&lt;li&gt;Ayuda a tu hijo a dominar las habilidades b&aacute;sicas de construcci&oacute;n con este sencillo modelo.&lt;/li&gt;
&lt;li&gt;Celebra una fiesta con dos fant&aacute;sticos personajes Disney: &iexcl;Mickey y Minnie!&lt;/li&gt;
&lt;li&gt;Construye la tarta y canta &ldquo;Cumplea&ntilde;os Feliz&rdquo;.&lt;/li&gt;
&lt;li&gt;&iexcl;Llena el tren de diversi&oacute;n y disfruta de tu propio desfile de cumplea&ntilde;os!&lt;/li&gt;
&lt;li&gt;Los productos LEGO&reg; DUPLO&reg; se dise&ntilde;an espec&iacute;ficamente para ser divertidos y f&aacute;ciles de usar en las manos de los m&aacute;s peque&ntilde;os.&lt;/li&gt;
&lt;li&gt;El tren mide m&aacute;s de 18 cm de altura, 34 cm de longitud y 6 cm de ancho.&lt;/li&gt;
&lt;li&gt;Edad: 2 - 5&lt;/li&gt;
&lt;li&gt;Piezas: 24&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&nbsp;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;T&eacute;rminos y condiciones:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;* Tienda Oficial de LEGO&reg;.&lt;/p&gt;
&lt;p&gt;* Garant&iacute;a: Sujetas a la marca.&lt;/p&gt;
&lt;p&gt;* Tiempo de entrega: De 6 a 10 d&iacute;as habiles a partir de la aprobaci&oacute;n del pago.&lt;/p&gt;
&lt;p&gt;* Valido hasta agotar existencias.&lt;/p&gt;
&lt;p&gt;* Unidades limitadas.&lt;/p&gt;
&lt;p&gt;* Precios sujetos a cambios sin previo aviso.&lt;/p&gt;
